<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  
  <!-- Supabase JS Client -->
  <script src="https://cdn.jsdelivr.net/npm/@supabase/supabase-js@2"></script>
  
  <!-- Supabase Initialization -->
  <script>
    // Supabase configuration
    const SUPABASE_URL = 'https://yritqctvxlhabyxwlisi.supabase.co';
    const SUPABASE_ANON_KEY = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InlyaXRxY3R2eGxoYWJ5eHdsaXNpIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NTA1OTMwNTMsImV4cCI6MjA2NjE2OTA1M30.g82egwBOdKCSw11rbySbgXa98N2w49ZRROHE2gT0P9k';
    
    let supabaseClient = null;
    
    // Wait for Supabase SDK to load
    function waitForSupabase(callback, maxAttempts) {
      maxAttempts = maxAttempts || 50; // Try for up to 5 seconds (50 * 100ms)
      var attempts = 0;
      
      function checkSupabase() {
        attempts++;
        if (typeof window.supabase !== 'undefined' && window.supabase.createClient) {
          console.log('[Supabase] SDK loaded, initializing...');
          callback();
        } else if (attempts < maxAttempts) {
          setTimeout(checkSupabase, 100);
        } else {
          console.error('[Supabase] Supabase SDK failed to load after ' + (maxAttempts * 100) + 'ms');
        }
      }
      
      checkSupabase();
    }
    
    // Initialize Supabase once SDK is loaded
    waitForSupabase(function() {
      if (SUPABASE_URL && SUPABASE_ANON_KEY) {
        try {
          supabaseClient = window.supabase.createClient(SUPABASE_URL, SUPABASE_ANON_KEY);
          console.log('[Supabase] Client initialized successfully');
        } catch (error) {
          console.error('[Supabase] Failed to initialize:', error);
        }
      }
    });
  </script>
  
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=Lexend:wght@100..900&display=swap" rel="stylesheet">
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'HubSpot Sans', sans-serif;
      font-size: 11px;
      line-height: 1.4;
      background: #ffffff;
      color: #000000;
    }

    .container {
      padding: 8px;
      padding-bottom: 40px; /* Space for feedback link */
      height: 100vh;
      overflow-y: auto;
      display: flex;
      flex-direction: column;
    }

    .header {
      margin-bottom: 12px;
    }

    .header-title {
      font-size: 16px;
      font-weight: 500;
      color: #000000;
      margin-bottom: 4px;
    }

    .header-subtitle {
      font-size: 12px;
      font-weight: 400;
      color: #666666;
    }

    .scan-button {
      width: 100%;
      padding: 12px 8px;
      background: #000000;
      color: #ffffff;
      border: 1px solid #000000;
      border-radius: 6px;
      font-size: 12px;
      font-weight: 500;
      cursor: pointer;
      transition: background 0.1s;
      margin-bottom: 16px;
    }

    .scan-button:hover {
      background: #333333;
    }

    .scan-button:active {
      background: #1a1a1a;
    }

    .scan-button:disabled {
      background: #f0f0f0;
      color: #999999;
      border-color: #e5e5e5;
      cursor: not-allowed;
    }

    .score-section {
      background: #ffffff;
      padding: 8px;
      margin-top: 8px;
      border: none;
      text-align: center;
    }

    .score-header {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 4px;
      margin-bottom: 8px;
    }

    .score-icon {
      font-size: 16px;
    }

    .score-label {
      font-size: 16px;
      font-weight: 500;
      margin-bottom: 8px;
    }

    .score-value {
      font-size: 48px;
      font-weight: 400;
      color: #000000;
      margin-bottom: 4px;
    }

    .score-text {
      font-size: 12px;
      font-weight: 400;
      text-align: center;
    }

    .summary-section {
      background: #f8f8f8;
      border-left: 1px solid #e5e5e5;
      border-radius: 6px;
      padding: 8px;
      margin-bottom: 24px;
    }

    .summary-title {
      font-size: 12px;
      font-weight: 500;
      color: #000000;
      margin-bottom: 8px;
    }

    .summary-item {
      font-size: 12px;
      font-weight: 400;
      color: #000000;
      margin-bottom: 4px;
    }

    .summary-item:last-child {
      margin-bottom: 0;
    }

    .tabs {
      display: flex;
      gap: 0;
      border-bottom: 1px solid #e5e5e5;
      margin-bottom: 16px;
      flex-shrink: 0;
      background: #ffffff;
      overflow: hidden;
    }

    .tab {
      flex: 1;
      padding: 6px 8px;
      text-align: center;
      cursor: pointer;
      border: none;
      background: transparent;
      font-size: 12px;
      font-weight: 500;
      color: #666666;
      border-bottom: 1px solid transparent;
      transition: color 0.1s;
      position: relative;
    }

    .tab:hover {
      color: #000000;
    }

    .tab.active {
      color: #000000;
      font-weight: 600;
      border-bottom-color: #000000;
    }

    .tab-badge {
      display: inline-block;
      background: #e5e5e5;
      color: #000000;
      border-radius: 6px;
      padding: 1px 4px;
      font-size: 12px;
      font-weight: 500;
      margin-left: 4px;
    }

    #tabsContainer {
      display: flex;
      flex-direction: column;
      flex: 1;
      overflow: hidden;
      background: #ffffff;
    }

    .tab-content {
      display: none;
      flex: 1;
      overflow-y: auto;
      padding: 8px;
    }

    .tab-content.active {
      display: block;
    }

    .component-item {
      background: #ffffff;
      border: 1px solid #e5e5e5;
      border-radius: 6px;
      padding: 6px 8px;
      margin-bottom: 8px;
      cursor: pointer;
      transition: background 0.1s;
    }

    .component-item:hover {
      background: #f8f8f8;
    }

    .component-header {
      display: flex;
      align-items: flex-start;
      gap: 8px;
      margin-bottom: 4px;
    }

    .component-badge {
      display: inline-block;
      padding: 2px 4px;
      border-radius: 6px;
      font-size: 10px;
      font-weight: 500;
      white-space: nowrap;
      flex-shrink: 0;
    }

    .badge-compliant {
      background: #e5e5e5;
      color: #000000;
    }

    .badge-error {
      background: #ffe5e5;
      color: #cc0000;
    }

    .badge-warning {
      background: #fff4e5;
      color: #cc6600;
    }

    .component-info {
      font-size: 12px;
      font-weight: 400;
      color: #666666;
      margin-bottom: 4px;
      padding-left: 0;
    }

    .component-source {
      font-weight: 400;
      color: #000000;
      flex: 1;
      font-size: 12px;
    }

    .category {
      margin-bottom: 16px;
    }

    .category-title {
      font-size: 16px;
      font-weight: 500;
      color: #000000;
      margin-bottom: 12px;
      padding-bottom: 8px;
      border-bottom: 1px solid #e5e5e5;
      display: flex;
      align-items: center;
      gap: 4px;
    }

    .empty-state {
      text-align: center;
      padding: 24px 16px;
      color: #999999;
    }

    .empty-state-icon {
      width: 200px;
      height: auto;
      opacity: 0.6;
    }

    .empty-state-text {
      font-size: 24px;
      font-weight: 400;
      font-family: 'HubSpot Serif', serif;
      color: #000000;
      margin: 0 16px 24px 16px;
      line-height: 1.4;
    }
    .empty-state-text-second {
      font-size: 16px;
      display: block;
      margin-top: 8px;
    }

    .empty-state .scan-button {
      margin-top: 24px;
      max-width: 200px;
    }

    #scoreCard .scan-button {
      margin-top: 16px;
    }

    .loading {
      text-align: center;
      padding: 16px;
      color: #999999;
    }

    .spinner {
      display: inline-block;
      animation: spin 1s linear infinite;
      font-size: 16px;
      margin-bottom: 8px;
    }

    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }

    .error-message {
      background: #fff4f4;
      border: 1px solid #ffe5e5;
      border-radius: 6px;
      padding: 8px;
      margin-bottom: 8px;
      color: #cc0000;
      font-size: 12px;
      font-weight: 400;
    }

    .error-message strong {
      display: block;
      margin-bottom: 4px;
      font-weight: 600;
    }

    #emptyState {
      flex: 1;
      display: flex;
      align-items: center;
      justify-content: center;
    }

    #scoreCard {
      flex-shrink: 0;
    }

    .feedback-button {
      position: fixed;
      bottom: 32px;
      right: 16px;
      padding: 0;
      background: transparent;
      color: #000000;
      border: none;
      font-size: 12px;
      font-weight: 400;
      text-decoration: none;
      cursor: pointer;
      transition: opacity 0.1s;
      z-index: 1000;
    }

    .feedback-button:hover {
      opacity: 0.7;
    }

    .modal-overlay {
      display: none;
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      background: rgba(0, 0, 0, 0.5);
      z-index: 2000;
      align-items: center;
      justify-content: center;
    }

    .modal-overlay.active {
      display: flex;
    }

    .modal {
      background: #ffffff;
      border-radius: 8px;
      padding: 16px;
      width: 90%;
      max-width: 400px;
      max-height: 80vh;
      overflow-y: auto;
    }

    .modal-header {
      font-size: 16px;
      font-weight: 500;
      margin-bottom: 12px;
      color: #000000;
    }

    .modal-body {
      margin-bottom: 16px;
    }

    .modal-body textarea {
      width: 100%;
      min-height: 120px;
      padding: 8px;
      border: 1px solid #e5e5e5;
      border-radius: 6px;
      font-size: 12px;
      font-family: inherit;
      resize: vertical;
      box-sizing: border-box;
    }

    .modal-body a {
      color: #000000;
      text-decoration: none;
      font-size: 11px;
      display: block;
      margin-top: 8px;
    }

    .modal-footer {
      display: flex;
      gap: 8px;
      justify-content: flex-end;
    }

    .modal-button {
      padding: 6px 12px;
      border-radius: 6px;
      font-size: 12px;
      font-weight: 500;
      cursor: pointer;
      border: 1px solid #e5e5e5;
      background: #ffffff;
      color: #000000;
    }

    .modal-button:hover {
      background: #f8f8f8;
    }

    .modal-button-primary {
      background: #000000;
      color: #ffffff;
      border-color: #000000;
    }

    .modal-button-primary:hover {
      background: #333333;
    }

    .modal-button:disabled {
      opacity: 0.5;
      cursor: not-allowed;
    }
  </style>
</head>
<body>
  <div class="container">

    <div id="messageContainer"></div>

    <div id="scoreCard" style="display: none;">
      <div class="score-section">
        <div class="score-header">
          <div>
            <div class="score-label">Compliance Score</div>
            <div style="display: flex; align-items: center; justify-content: center; gap: 4px;">
              <div class="score-icon">✨</div>
              <div class="score-value" id="scoreValue">0%</div>
            </div>
          </div>
        </div>
        <div class="score-text" id="scoreDescription"></div>
      </div>

      <button class="scan-button" id="scanBtnResults">Scan Frame</button>

      <div id="summaryBox"></div>
    </div>

    <div id="tabsContainer" style="display: none;">
      <div class="tabs">
        <button class="tab active" data-tab="libraries">✓ Libraries <span class="tab-badge" id="libCount">0</span></button>
        <button class="tab" data-tab="issues">⚠ Issues <span class="tab-badge" id="issueCount">0</span></button>
      </div>

      <div class="tab-content active" id="libraries-tab"></div>
      <div class="tab-content" id="issues-tab"></div>
    </div>

    <div id="emptyState">
      <div class="empty-state">
        <div class="empty-state-text">Select a frame to scan</div>
        <img class="empty-state-icon" id="emptyStateImage" src="" alt="" />
        <button class="scan-button" id="scanBtn">Scan Frame</button>
      </div>
    </div>
  </div>

    ];
    const randomImage = emptyStateImages[Math.floor(Math.random() * emptyStateImages.length)];
    const emptyStateImageEl = document.getElementById('emptyStateImage');
    if (emptyStateImageEl) {
      emptyStateImageEl.src = randomImage;
      emptyStateImageEl.alt = 'Empty state illustration';
      emptyStateImageEl.onerror = function() {
        // Hide image on error
        this.style.display = 'none';
      };
      emptyStateImageEl.onload = function() {
        // Image loaded successfully
      };
    }

    // Randomly select an empty state message
    const emptyStateMessages = [
      'Scanners are go, captain. Just need you to select a frame',
      'Pick a frame, any frame',
      'Awaiting frame selection. Is this what it feels like to wait for a designer to finalize mockups?',
      'Frame selection pending. Meanwhile, somewhere a designer is adding another shade of gray',
      'No frame selected. Somewhere, a design system maintainer is waiting breathlessly'
    ];
    const randomMessage = emptyStateMessages[Math.floor(Math.random() * emptyStateMessages.length)];
    const emptyStateTextEl = document.querySelector('.empty-state-text');
    if (emptyStateTextEl) {
      // Split message by period followed by space to separate sentences
      const parts = randomMessage.split(/\.\s+/).filter(p => p.trim());
      if (parts.length > 1) {
        // Two sentences: first sentence on one line, second on next line with smaller font
        const firstSentence = parts[0].trim() + '.';
        const secondSentence = parts[1].trim();
        emptyStateTextEl.innerHTML = firstSentence + '<span class="empty-state-text-second">' + secondSentence + '</span>';
      } else {
        // Single sentence: display as is
        emptyStateTextEl.textContent = randomMessage;
      }
    }

    const scanBtn = document.getElementById('scanBtn');
    const scanBtnResults = document.getElementById('scanBtnResults');
    const emptyState = document.getElementById('emptyState');
    const scoreCard = document.getElementById('scoreCard');
    const tabsContainer = document.getElementById('tabsContainer');
    const messageContainer = document.getElementById('messageContainer');
    const tabs = document.querySelectorAll('.tab');

    let currentResults = null;

    // Shared scan function
    function performScan() {
      messageContainer.innerHTML = '';
      const buttons = [scanBtn, scanBtnResults].filter(btn => btn);
      buttons.forEach(btn => {
        btn.disabled = true;
        btn.textContent = 'Scanning...';
      });
      emptyState.style.display = 'none';
      scoreCard.style.display = 'none';
      tabsContainer.style.display = 'none';
      const loadingDiv = document.createElement('div');
      loadingDiv.className = 'loading';
      loadingDiv.innerHTML = '<div class="spinner">⏳</div> Scanning your design...';
      messageContainer.innerHTML = '';
      messageContainer.appendChild(loadingDiv);
      parent.postMessage({ pluginMessage: { type: 'scan-page' } }, '*');
    }

    // Tab switching
    tabs.forEach(tab => {
      tab.addEventListener('click', () => {
        tabs.forEach(t => t.classList.remove('active'));
        document.querySelectorAll('.tab-content').forEach(c => c.classList.remove('active'));
        
        tab.classList.add('active');
        const tabId = tab.getAttribute('data-tab');
        document.getElementById(`${tabId}-tab`).classList.add('active');
      });
    });

    // Scan page - both buttons
    if (scanBtn) {
      scanBtn.addEventListener('click', performScan);
    }
    if (scanBtnResults) {
      scanBtnResults.addEventListener('click', performScan);
    }

    // Get user ID from plugin
    let currentUserId = null;

    // Listen for messages from plugin
    onmessage = (event) => {
      const msg = event.data.pluginMessage;
      
      // Handle user ID response
      if (msg.type === 'user-id') {
        currentUserId = msg.userId;
        return;
      }
      
      // Handle analytics tracking messages
      if (msg.type === 'track-event') {
        console.log('[Analytics] Received track-event:', msg.eventName, msg.eventData);
        
        // Send to Supabase
        if (supabaseClient) {
          supabaseClient
            .from('analytics_events')
            .insert([
              {
                event_type: msg.eventName,
                user_id: msg.eventData.user_id || null,
                elements_scanned: msg.eventData.elements_scanned || 0,
                compliance_score: msg.eventData.compliance_score || 0,
                library_components: msg.eventData.library_components || 0,
                local_components: msg.eventData.local_components || 0,
                custom_shapes: msg.eventData.custom_shapes || 0,
                custom_text: msg.eventData.custom_text || 0,
                figma_version: msg.eventData.figma_version || null,
                plugin_version: msg.eventData.plugin_version || null,
              },
            ])
            .then(({ data, error }) => {
              if (error) {
                console.error('[Supabase] Error sending event:', error);
              } else {
                console.log('[Supabase] Event sent successfully:', msg.eventName);
              }
            })
            .catch(error => {
              console.error('[Supabase] Network error:', error);
            });
        }
        
        return; // Don't process further, this is a tracking message
      }

      if (msg.type === 'scan-results') {
        const buttons = [scanBtn, scanBtnResults].filter(btn => btn);
        buttons.forEach(btn => {
          btn.disabled = false;
          btn.textContent = 'Scan Frame';
        });
        currentResults = msg.data;
        displayResults(msg.data);
      } else if (msg.type === 'error') {
        const buttons = [scanBtn, scanBtnResults].filter(btn => btn);
        buttons.forEach(btn => {
          btn.disabled = false;
          btn.textContent = 'Scan Frame';
        });
        showError(msg.message);
      }
    };

    function displayResults(data) {
      const { libraryComponents, localComponents, customShapes, customText, totalElementsScanned, complianceScore } = data;

      // Hide empty state and loading
      emptyState.style.display = 'none';
      messageContainer.innerHTML = '';

      // Show score and tabs
      scoreCard.style.display = 'block';
      tabsContainer.style.display = 'flex';

      // Update score
      document.getElementById('scoreValue').textContent = complianceScore + '%';
      
      // Score description
      const issueCount = localComponents.length + customShapes.length + customText.length;
      const libCount = libraryComponents.length;
      const totalElements = libCount + issueCount;
      document.getElementById('scoreDescription').textContent = `${libCount} of ${totalElements} elements compliant`;

      // Update tab counts
      document.getElementById('libCount').textContent = libraryComponents.length;
      document.getElementById('issueCount').textContent = issueCount;

      // Summary
      if (libraryComponents.length > 0) {
        const byLibrary = {};
        libraryComponents.forEach((comp) => {
          const lib = comp.libraryName || 'Unknown';
          if (!byLibrary[lib]) byLibrary[lib] = [];
          byLibrary[lib].push(comp);
        });

        let summaryHtml = '<div class="summary-section"><div class="summary-title">📚 Libraries Found</div>';
        for (const [libName, comps] of Object.entries(byLibrary)) {
          summaryHtml += `<div class="summary-item">${libName} — ${comps.length} component${comps.length !== 1 ? 's' : ''} used</div>`;
        }
        summaryHtml += '</div>';
        document.getElementById('summaryBox').innerHTML = summaryHtml;
      } else {
        document.getElementById('summaryBox').innerHTML = '';
      }

      // Libraries tab
      let libHtml = '';
      if (libraryComponents.length > 0) {
        const byLibrary = {};
        libraryComponents.forEach((comp) => {
          const lib = comp.libraryName || 'Unknown';
          if (!byLibrary[lib]) byLibrary[lib] = [];
          byLibrary[lib].push(comp);
        });

        libHtml += `<div class="category"><div class="category-title">✓ Library Components</div>`;
        for (const [libName, comps] of Object.entries(byLibrary)) {
          libHtml += `<div style="margin-bottom: 12px;"><div style="font-size: 12px; font-weight: 500; color: #666666; margin-bottom: 8px;">📦 ${libName} (${comps.length})</div>`;
          comps.forEach((comp) => {
            libHtml += `
              <div class="component-item" data-node-id="${comp.nodeId}">
                <div class="component-header">
                  <span class="component-badge badge-compliant">✓</span>
                  <div class="component-source">${comp.componentName}</div>
                </div>
              </div>
            `;
          });
          libHtml += `</div>`;
        }
        libHtml += `</div>`;
      } else {
        libHtml = `<div class="empty-state" style="padding: 24px 16px;"><div class="empty-state-text">No library components found</div></div>`;
      }
      document.getElementById('libraries-tab').innerHTML = libHtml;

      // Issues tab
      let issuesHtml = '';
      if (localComponents.length > 0) {
        issuesHtml += `<div class="category"><div class="category-title">✗ Local Components</div>`;
        localComponents.forEach((comp) => {
          issuesHtml += `
            <div class="component-item" data-node-id="${comp.nodeId}">
              <div class="component-header">
                <span class="component-badge badge-error">Error</span>
                <div class="component-source">${comp.componentName}</div>
              </div>
              <div class="component-info">Should be replaced with a library component</div>
            </div>
          `;
        });
        issuesHtml += `</div>`;
      }

      if (customShapes.length > 0) {
        issuesHtml += `<div class="category"><div class="category-title">⚠ Custom Shapes</div>`;
        customShapes.forEach((shape) => {
          issuesHtml += `
            <div class="component-item" data-node-id="${shape.nodeId}">
              <div class="component-header">
                <span class="component-badge badge-warning">Warning</span>
                <div class="component-source">${shape.nodeName}</div>
              </div>
              <div class="component-info">Type: ${shape.type} — Consider using a component</div>
            </div>
          `;
        });
        issuesHtml += `</div>`;
      }

      if (customText.length > 0) {
        issuesHtml += `<div class="category"><div class="category-title">⚠ Custom Text</div>`;
        customText.forEach((text) => {
          issuesHtml += `
            <div class="component-item" data-node-id="${text.nodeId}">
              <div class="component-header">
                <span class="component-badge badge-warning">Warning</span>
                <div class="component-source">${text.nodeName}</div>
              </div>
              <div class="component-info">Raw text — Use a text component instead</div>
            </div>
          `;
        });
        issuesHtml += `</div>`;
      }

      if (localComponents.length === 0 && customShapes.length === 0 && customText.length === 0) {
        issuesHtml = `<div class="empty-state" style="padding: 24px 16px;"><div class="empty-state-text">No issues found!</div></div>`;
      }

      document.getElementById('issues-tab').innerHTML = issuesHtml;

      // Add click handlers
      document.querySelectorAll('.component-item').forEach((item) => {
        item.addEventListener('click', () => {
          const nodeId = item.getAttribute('data-node-id');
          parent.postMessage({ pluginMessage: { type: 'navigate-to-node', nodeId } }, '*');
        });
      });
    }

    function showError(message) {
      messageContainer.innerHTML = `<div class="error-message"><strong>Error</strong>${message}</div>`;
      emptyState.style.display = 'flex';
      scoreCard.style.display = 'none';
      tabsContainer.style.display = 'none';
    }

    // Feedback functionality
    const feedbackButton = document.createElement('button');
    feedbackButton.className = 'feedback-button';
    feedbackButton.textContent = '💬 Feedback';
    feedbackButton.setAttribute('aria-label', 'Provide feedback');
    document.body.appendChild(feedbackButton);

    const modalOverlay = document.createElement('div');
    modalOverlay.className = 'modal-overlay';
    modalOverlay.innerHTML = `
      <div class="modal">
        <div class="modal-header">Provide Feedback</div>
        <div class="modal-body">
          <textarea id="feedbackText" placeholder="Share your thoughts, suggestions, or report issues..."></textarea>
          <a href="https://rtwest.github.io/trellis-checker/" target="_blank">View Dashboard</a>
        </div>
        <div class="modal-footer">
          <button class="modal-button" id="cancelFeedback">Cancel</button>
          <button class="modal-button modal-button-primary" id="submitFeedback">Submit</button>
        </div>
      </div>
    `;
    document.body.appendChild(modalOverlay);

    feedbackButton.addEventListener('click', () => {
      modalOverlay.classList.add('active');
      document.getElementById('feedbackText').focus();
    });

    document.getElementById('cancelFeedback').addEventListener('click', () => {
      modalOverlay.classList.remove('active');
      document.getElementById('feedbackText').value = '';
    });

    modalOverlay.addEventListener('click', (e) => {
      if (e.target === modalOverlay) {
        modalOverlay.classList.remove('active');
        document.getElementById('feedbackText').value = '';
      }
    });

    document.getElementById('submitFeedback').addEventListener('click', async () => {
      const feedbackText = document.getElementById('feedbackText').value.trim();
      if (!feedbackText) {
        alert('Please enter your feedback');
        return;
      }

      const submitButton = document.getElementById('submitFeedback');
      submitButton.disabled = true;
      submitButton.textContent = 'Submitting...';

      try {
        // Request user ID from plugin
        parent.postMessage({ pluginMessage: { type: 'get-user-id' } }, '*');
        
        // Wait a bit for the response
        await new Promise(resolve => setTimeout(resolve, 100));

        // Submit feedback to Supabase
        if (supabaseClient) {
          const { data, error } = await supabaseClient
            .from('feedback')
            .insert([
              {
                user_id: currentUserId,
                feedback_text: feedbackText,
              },
            ]);

          if (error) {
            throw error;
          }

          alert('Thank you for your feedback!');
          modalOverlay.classList.remove('active');
          document.getElementById('feedbackText').value = '';
        } else {
          throw new Error('Supabase client not initialized');
        }
      } catch (error) {
        console.error('Error submitting feedback:', error);
        alert('Failed to submit feedback. Please try again.');
      } finally {
        submitButton.disabled = false;
        submitButton.textContent = 'Submit';
      }
    });
  </script>
</body>
</html>
